// File: contracts/operatorstorage.sol

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;
interface i1155 {
    function gflame(string memory flame_) external pure returns(address);
    function getContract(address contract_) external returns(bool);
    function getoperator(address operator_, uint256 license_) external pure returns(uint256[4] memory,uint256[] memory,uint256,uint256,uint256,address);
    function fire(address caller_) external pure returns(uint256[] memory,uint256[] memory,uint256,bool,bool,uint256);
    function removeoperator(address operator_, uint256 opid_) external returns(bool);
    function balanceOf(address holder, uint256 nftea_) external returns(uint256);
}

contract operatorstorage {

    struct OP{
        address operator;
        address wallet;
        uint256 label;
        uint256 license;
        uint256 expire;
        uint256 wdays;
        uint256 nextwithdraw;
        uint256 wamount1;
        uint256 wamount2;
        uint256 role;
    }
    mapping(uint256=>OP) public _op;
    mapping(uint256=>uint256) public _opsx;
    mapping(address=>mapping(uint256=>uint256)) public _operator2label2ops;
    mapping(address=>uint256[]) public _operator2ops;
    mapping(address=>mapping(uint256=>uint256)) public _operator2opsx;
    mapping(uint256=>address[]) public _label2operators;
    mapping(uint256=>mapping(address=>uint256)) public _label2operatorsx;
    mapping(uint256=>address[]) public _label2activeoperators;
    mapping(uint256=>mapping(address=>uint256)) public _label2activeoperatorsx;
    mapping(uint256=>mapping(address=>uint256)) public _license2operator2label;
    mapping(uint256=>mapping(uint256=>address)) public _license2label2wallet;
    mapping(address=>mapping(uint256=>uint256)) public _seller2label2marketplacelicense;
    mapping(uint256=>uint256) public _label2ops;
    string public name = "OPERATOR STORAGE V1";
    uint256 public _opid;
    address public _fire;

    constructor(address fire_){
        _fire = fire_;
        _opid = 0;
    }

function setoperator(uint256 labelnftea_, address operator_, address wallet_, uint256 license_,uint256 expire_, uint256 role_) external returns(bool){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin operatorstorage 1');
        if(expire_>0){
            expire_ = block.timestamp + expire_* 24 hours;
        }
        _opid += 1;
        OP memory save_  = OP({
            operator: operator_,
            wallet: wallet_,
            label: labelnftea_,
            license: license_,
            expire: expire_,
            wdays:0,
            nextwithdraw:0,
            wamount1:0,
            wamount2:0,
            role: role_
        });
        _op[_opid] = save_;
        _operator2ops[operator_].push(_opid);
        _operator2opsx[operator_][_opid] = _operator2ops[operator_].length - 1;
        _operator2label2ops[operator_][labelnftea_]= _opid;
        _label2operators[labelnftea_].push(operator_);
        _label2operatorsx[labelnftea_][operator_] = _label2operators[labelnftea_].length - 1;

        _label2activeoperators[labelnftea_].push(operator_);
        _label2activeoperatorsx[labelnftea_][operator_] = _label2activeoperators[labelnftea_].length - 1;

        _license2operator2label[license_][operator_] = labelnftea_;
        _license2label2wallet[license_][labelnftea_] = wallet_;
        if(_label2ops[labelnftea_]==0){
          _label2ops[labelnftea_] = _opid;
        }
        return true;
    }
    function setnW(uint256 opid_, uint256 nw) external returns(bool){
      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'not approved');
      _op[opid_].nextwithdraw = nw;
      return true;
    }
    function updateoperator(uint256 labelnftea_, address to_) external returns(bool){
      (bool success) = i1155(_fire).getContract(msg.sender);
      if(!success){
        (address flame_) = i1155(_fire).gflame('mintcontract');
        uint256 balance = i1155(flame_).balanceOf(msg.sender,labelnftea_);
        require(balance==1, 'you do not own this nftea');
        to_ = msg.sender;
      }else{
        require(success, 'not an admin operatorstorage 2');
      }
      //remove previous operator
      uint256 _operatorid = _label2ops[labelnftea_];
      if(_operatorid>0){
        address from_ = _op[_operatorid].operator;
        _operator2ops[from_][_operator2opsx[from_][_operatorid]] = _operator2ops[from_][_operator2ops[from_].length -1];
        _operator2ops[from_].pop();
        _label2operators[labelnftea_] = new address[](0);
        _label2activeoperators[labelnftea_] = new address[](0);
        _label2activeoperatorsx[labelnftea_][from_] = 0;
        _license2operator2label[_op[_operatorid].license][from_] = 0;

        //add new operator
        _operator2ops[to_].push(_operatorid);
        _operator2opsx[to_][_operatorid] = _operator2ops[to_].length - 1;
        _operator2label2ops[to_][labelnftea_]= _operatorid;
        _label2operators[labelnftea_].push(to_);
        _label2operatorsx[labelnftea_][to_] = _label2operators[labelnftea_].length - 1;
        _label2activeoperators[labelnftea_].push(to_);
        _label2activeoperatorsx[labelnftea_][to_] = _label2activeoperators[labelnftea_].length - 1;
        _license2operator2label[labelnftea_][to_] = labelnftea_;
        _op[_operatorid].license = labelnftea_;
        _op[_operatorid].expire = 0;
        _op[_operatorid].operator = to_;
      }
      return true;
    }
    function setwithdrawsettings( uint256[] memory numbers_, address operator_,uint256 nftea_) external returns(bool){
        ///reset all settings if needed
        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin operatorstorage 3');
        ///validate super operator
        uint256 opid_ = _operator2label2ops[operator_][nftea_];
        _op[opid_].wdays = numbers_[2];
        _op[opid_].nextwithdraw = numbers_[3];
        _op[opid_].wamount1 = numbers_[1];
        _op[opid_].wamount2 = numbers_[0];
        _op[opid_].expire = block.timestamp * numbers_[4] + 24 hours; /// license expire in days
        return true;
    }
    function setrole(uint256 license_, uint256 role_, address operator_) external returns(bool){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not angetoperator admin');

        uint256 opid_ = _operator2label2ops[operator_][license_];
        _op[opid_].role = role_;
        return true;

    }

    function removeoperator(address operator_, uint256 opid_) external returns(bool){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin operatorstorage 4');
        uint256 label_ = _op[_opid].label;
        uint256 license_ = _op[_opid].license;

        _license2operator2label[license_][operator_] = 0;
        _operator2ops[operator_][_operator2opsx[operator_][opid_]] = _operator2ops[operator_].length - 1;
        _operator2ops[operator_].pop();
        _operator2label2ops[operator_][label_] = 0;
        _label2activeoperatorsx[label_][operator_] = _label2activeoperators[label_].length - 1;
        _label2activeoperators[label_].pop();
        _op[opid_].label = 0;
        return true;
    }
    function getlabeloperators(uint256 nftea_) public view returns(address[] memory, uint256[] memory, uint256[] memory,uint256[] memory){

      uint256[] memory license = new uint256[](_label2operators[nftea_].length);
      uint256[] memory expire = new uint256[](_label2operators[nftea_].length);
      uint256[] memory role = new uint256[](_label2operators[nftea_].length);

      for (uint256 i = 0; i < _label2operators[nftea_].length; ++i) {
        license[i] = _op[_operator2label2ops[_label2operators[nftea_][i]][nftea_]].license;
        expire[i] = _op[_operator2label2ops[_label2operators[nftea_][i]][nftea_]].expire;
        role[i] = _op[_operator2label2ops[_label2operators[nftea_][i]][nftea_]].role;
      }

        return (_label2operators[nftea_], license, expire, role);
    }
    function getoperator(address operator_, uint256 label_) public view returns(uint256[4] memory,uint256[] memory,uint256,uint256,uint256,uint256,address){

        uint256 opid_ = _operator2label2ops[operator_][label_];
        if(opid_<1){
          opid_ = _operator2label2ops[operator_][_license2operator2label[label_][operator_]];
        }
        address wallet_ = address(0);
        if(opid_>0){
            wallet_ = _op[opid_].wallet;
        }else{
            opid_= 0;
        }
        uint256[4] memory wsettings_;
        wsettings_[0] =_op[opid_].wdays;
        wsettings_[1] =_op[opid_].nextwithdraw;
        wsettings_[2] =_op[opid_].wamount1;
        wsettings_[3] =_op[opid_].wamount2;
        return(wsettings_,_operator2ops[operator_], opid_,_op[opid_].expire,_op[opid_].label,_op[opid_].license,wallet_);
    }

    function getwithdrawsetting(uint256 opid_) external view returns(uint256,uint256,uint256,uint256,uint256){

        return(_op[opid_].wdays, _op[opid_].nextwithdraw, _op[opid_].expire,_op[opid_].wamount1,_op[opid_].wamount2);
    }
    function getlicense2nftea2operate(uint256 license_,address operator_) public view returns(uint256, address){

        return (_license2operator2label[license_][operator_], _license2label2wallet[license_][_license2operator2label[license_][operator_]]);
    }
    function getop(uint256 opid_) public view returns(OP memory){

        return _op[opid_];
    }
    function getoperatorlicenses(address operator_) public view returns(uint256[] memory){

        return _operator2ops[operator_];
    }
    function getoperatorrole(uint256 opid_) public view returns(uint256){
        return _op[opid_].role;
    }
    function checksuperop(uint256 license_, address operator_) public view returns(address){
        uint256 label_ = _license2operator2label[license_][operator_];
        uint256 opid_ = _operator2label2ops[operator_][label_];
        address operator = address(0);
        if(opid_>0){
          operator = _op[opid_].operator;
        }
        return operator;
    }
}
